let slick, selectedAverage, rows;
slick = (API.getData('slick') === null || API.getData('slick') === undefined) ? slick = []: slick = API.getData('slick').resurrect();
let elements = slick.map(item => item.pozos);
rows = (API.getData('absorbances') === null || API.getData('absorbances') === undefined) ? rows = []: rows = API.getData('absorbances').resurrect();
selectedAverage = (API.getData('selectedAverage') === null || API.getData('selectedAverage') === undefined) ? selectedAverage = []: selectedAverage = API.getData('selectedAverage').resurrect();

let list = selectedAverage.map(x => JSON.stringify(x.pozos));
let entry = rows.filter(item => list.find(element => element === JSON.stringify(item.pozos)) === undefined)
if (this.action) {
    switch (this.action.name) {
        case 'showOnlySpectra': 
            removeAll();
            for (let i = 0; i < entry.length; i++) {
                pushRow(entry[i])
            }
            API.createData('selectedAverage', selectedAverage);
            break;

        case 'showSpectra': 
            for (let i = 0; i < entry.length; i++) {
                pushRow(entry[i])
            }
            API.createData('selectedAverage', selectedAverage);
            break;

        case 'hideSpectra':
            let remove = rows.filter(item => list.find(element => element === JSON.stringify(item.pozos)) !== undefined)
            for (let i = 0; i < remove.length; i++) {
                removeRow(remove[i])
            }
            API.createData('selectedAverage', selectedAverage);
            break;

        case 'hideAllSpectra':
            removeAll();
            API.createData('selectedAverage', selectedAverage);
            break;

        case 'showAllSpectra':
            for (let i = 0; i < slick.length; i++) {
                pushRow(slick[i])
            }
            API.createData('selectedAverage', selectedAverage);
            break;
    }
}

function pushRow(row) {
    selectedAverage.push({
        name: row.name,
        pozos: row.pozos,
        concentration: row.concentration,
        extract: row.extract,
        color: row.color,
        value: row.value
    })
}

function removeRow(row) {
    let index = selectedAverage.map(x => JSON.stringify(x.pozos)).findIndex(x => x === JSON.stringify(row.pozos))
    selectedAverage.splice(index, 1);
}

function removeAll() {
    selectedAverage = [];
}

